import History from '../history/history'
import {NavLink} from 'react-router-dom';
import h from './header.module.css';
 const Header = (props)=> {
     console.log(props.myTask);
     
    return (
        <div className={h.container}>
            {props.myTask.length && <div><img className={h.icon} src="https://img.icons8.com/color/48/000000/high-importance--v1.png"/></div>}
            <NavLink to='/active' activeClassName=''>  task </NavLink>
        </div>
     )
 }

 export default Header;
